import React, { useState} from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Login from './login/login-page.js'

function App() {
  return (
    <Router>
      <Routes>
        <Route path = '/' element = {<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
